<!DOCTYPE html>
<html lang="en">

<head>
	<meta charset="utf-8" />
	<meta name="viewport" content="width=device-width, initial-scale=1" />
	<link rel="manifest" href="%sveltekit.assets%/manifest.webmanifest" />
	<meta name="theme-color" content="#ffffff" />
	<link rel="shortcut icon" href="%sveltekit.assets%/favicon.ico" type="image/x-icon" />
	<link rel="icon" href="%sveltekit.assets%/favicon.ico" type="image/x-icon" />
	<link rel="apple-touch-icon" href="%sveltekit.assets%/apple-touch-icon.png" />
	<link rel="android-chrome-192x192" type="image/png" sizes="192x192"
		href="%sveltekit.assets%/android-chrome-192x192.png" />
	<link rel="android-chrome-512x512" type="image/png" sizes="512x512"
		href="%sveltekit.assets%/android-chrome-512x512.png" />
	<link rel="favicon-16x16" type="image/png" sizes="16x16" href="%sveltekit.assets%/favicon-16x16.png" />
	<link rel="favicon-32x32" type="image/png" sizes="16x16" href="%sveltekit.assets%/favicon-32x32.png" />
	<meta name="pwa-capable" content="yes" />
	%sveltekit.head%
</head>

<body data-sveltekit-preload-data="hover">
	<div style="display: contents">%sveltekit.body%</div>
</body>

</html>
